To replay you can use the following sqls (remember to disable cross_space_compaction)
```
create database db;
use db;
create table table1(id1 tag, s1 string);
insert into table1 values(0, 'd1', null), (1,'d1', 1);
flush;
insert into table1 values(0, 'd1', 0);
flush;
select * from table1;
```

